import React from 'react';

function Overlay({ image, onClose }) {
    return (
      <div className="overlay">
        <button className="close-button" onClick={onClose}>Close</button>
        <div className="image-container">
          <img src={image.src} alt={image.title} className="main-image" />
          {image.additionalImages.map((additionalImage, index) => (
            <img src={additionalImage} alt={`Additional Image ${index + 1}`} key={index} className="additional-image" />
          ))}
        </div>
        <div className="image-details">
          <h3 className="title">{image.title}</h3>
          <p className="year">{image.year}</p>
          {/* 추가적인 이미지 정보 */}
        </div>
      </div>
    );
  }


export default Overlay;
